class GifLabel(QLabel):
    buffer: QBuffer
    movie: QMovie

    def __init__(self, parent: QWidget, movie: QMovie, geometry: tuple[int, int, int, int] | None = None):
        super().__init__(parent)
        self.movie: QMovie = movie
        self.setMovie(self.movie)
        self.movie.start()
        self.hide()
        if geometry is not None:
            self.setGeometry(*geometry)


class AllImage:
    image: dict[Image, QPixmap] = {}
    ico: dict[IcoImage, QIcon] = {}
    gif: dict[GifImage, tuple[QBuffer, QMovie]] = {}

    @staticmethod
    def from_string(string: str) -> QPixmap:
        im = QPixmap()
        im.loadFromData(base64.b64decode(string))
        return im

    @classmethod
    def get_image(cls, image: Image) -> QPixmap:
        if image not in cls.image:
            pixmap: QPixmap = QPixmap()
            pixmap.loadFromData(base64.b64decode(image.value))
            cls.image[image] = pixmap
        return cls.image[image]

    @classmethod
    def get_gif(cls, parent: QWidget, gif: GifImage, geometry: tuple[int, int, int, int] | None = None) -> GifLabel:
        if gif not in cls.gif:
            buffer = QBuffer()
            buffer.setData(base64.b64decode(gif.value))
            movie = QMovie(buffer, b'gif')
            cls.gif[gif] = (buffer, movie)
        return GifLabel(parent, cls.gif[gif][1], geometry)

    @classmethod
    def get_ico(cls, ico: IcoImage) -> QIcon:
        if ico not in cls.ico:
            pixmap: QPixmap = QPixmap()
            pixmap.loadFromData(base64.b64decode(ico.value))
            icon: QIcon = QIcon()
            icon.addPixmap(pixmap)
            cls.ico[ico] = icon
        return cls.ico[ico]


def get_ico(category: str) -> Image:
    if category == '':
        return Image.MIN_UNKNOWN
    category = category.lower().replace('.', '')
    # 單副檔名
    generally = ['folder', 'exe', 'apk', 'cad', 'doc', 'epub', 'ipa', 'key', 'numbers', 'pages.', 'pdf', 'ppt', 'torrent', 'vsd']
    # 音訊副檔名
    music = ['mp3', 'aac', 'ogg', 'vorbis','opus', 'wav', 'flac', 'ape', 'alac', 'wavpack']
    # 影片副檔名
    video = ['flv', 'avi', 'wmv', 'asf', 'wmvhd', 'dat', 'vob', 'mpg', 'mpeg', 'mp4', '3gp', '3g2', 'mkv', 'rm', 'rmvb', 'mov', 'qt', 'ogg', 'ogv', 'oga', 'mod']
    # 試算表副檔名
    xls = ['xlsx', 'xltx', 'xls']
    # 壓縮副檔名
    compressed = ['rar', '7z', 'zip']
    # 圖片副檔名
    img = ['bmp', 'tiff', 'tif', 'png', 'gif', 'jpeg', 'jpg', 'psd', 'sai', 'psp', 'ufo', 'ps', 'eps', 'ai', 'svg', 'wmf']
    if category in generally:
        return getattr(Image, f'MIN_{category.upper()}')
    elif category in music:
        return Image.MIN_MUSIC
    elif category in video:
        return Image.MIN_VIDEO
    elif category in xls:
        return Image.MIN_XLS
    elif category in compressed:
        return Image.MIN_COMPRESSED
    elif category in img:
        return Image.MIN_IMG
    else:
        return Image.MIN_UNKNOWN


def get_transparent_pixmap(image: Image, transparency: int):
    p_map = AllImage.get_image(image)
    temp = QPixmap(p_map.size())
    temp.fill(Qt.transparent)
    p = QPainter(temp)
    p.setCompositionMode(QPainter.CompositionMode_Source)
    p.drawPixmap(0, 0, p_map)
    p.setCompositionMode(QPainter.CompositionMode_DestinationIn)
    p.fillRect(temp.rect(), QColor(0, 0, 0, transparency))
    p.end()
    p_map = temp
    return p_map
